import React from 'react';
import {useAuth0} from '@auth0/auth0-react';
import {Button} from 'react-bootstrap';

const LogoutButton = () => {
  const {logout} = useAuth0();

  return (
    <Button
      onClick = {() => logout({
        returnTo: window.location.origin,
      })}
      variant = "danger"
      className = "btn-margin"
    >
      Logout
    </Button>
  );
};

export default LogoutButton;
